import React, { useState } from 'react';
import {
  Home,
  Search,
  FileText,
  Globe2,
  Users,
  Settings,
  HelpCircle,
  Plane,
  MessageSquare,
} from 'lucide-react';

const SideNavigation = () => {
  const [isExpanded, setIsExpanded] = useState(false);

  const navigationItems = [
    { icon: <Home className="w-5 h-5" />, label: 'Home', path: '/' },
    { icon: <Search className="w-5 h-5" />, label: 'University Search', path: '/search' },
    { icon: <FileText className="w-5 h-5" />, label: 'My Applications', path: '/applications' },
    { icon: <Plane className="w-5 h-5" />, label: 'Visa Status', path: '/visa' },
    { icon: <Globe2 className="w-5 h-5" />, label: 'Country Guides', path: '/countries' },
    { icon: <MessageSquare className="w-5 h-5" />, label: 'Community', path: '/community' },
    { icon: <Settings className="w-5 h-5" />, label: 'Settings', path: '/settings' },
    { icon: <HelpCircle className="w-5 h-5" />, label: 'Help Center', path: '/help' },
  ];

  return (
    <div
      className={`h-screen bg-white border-r border-gray-200 transition-all duration-300 flex flex-col ${
        isExpanded ? 'w-64' : 'w-16'
      }`}
      onMouseEnter={() => setIsExpanded(true)}
      onMouseLeave={() => setIsExpanded(false)}
    >
      {/* Logo */}
      <div
        className={`border-b border-gray-100 transition-all ${
          isExpanded ? 'p-5' : 'p-3'
        }`}
      >
        <div className="flex items-center gap-2">
          <div className="w-6 h-6 bg-green-600 rounded-sm flex items-center justify-center flex-shrink-0">
            <div className="w-3 h-3 border-2 border-white rounded-sm"></div>
          </div>
          <span
            className={`text-xl font-semibold text-green-600 transition-opacity duration-300 ${
              isExpanded ? 'opacity-100' : 'opacity-0 w-0'
            }`}
          >
            StudyAbroad
          </span>
        </div>
      </div>

      {/* Navigation */}
      <nav className="flex-1 py-2">
        {navigationItems.map((item, index) => (
          <button
            key={index}
            className={`w-full flex items-center gap-3 hover:bg-gray-50 text-gray-600 hover:text-gray-900 group transition-all ${
              isExpanded ? 'px-5 py-3 justify-start' : 'p-3 justify-center'
            }`}
          >
            <div className="flex-shrink-0">{item.icon}</div>
            <span
              className={`text-sm font-medium whitespace-nowrap transition-opacity duration-300 ${
                isExpanded ? 'opacity-100' : 'opacity-0 w-0'
              }`}
            >
              {item.label}
            </span>
          </button>
        ))}
      </nav>

      {/* Account Status Banner */}
      {isExpanded && (
        <div className="m-3 p-3 bg-blue-50 rounded-md">
          <p className="text-xs text-blue-600">Application Status: Pending</p>
        </div>
      )}
    </div>
  );
};

export default SideNavigation;
